import React from "react";

const footer = () => {
  const userString = sessionStorage.getItem("user");
  const user = userString ? JSON.parse(userString) : null;
  return (
    <footer>
    <div className="self-stretch overflow-hidden flex flex-row items-center justify-center p-[30px] z-[9] text-center text-xl">
      <div className="h-[50px] flex flex-row items-center justify-center gap-[60px]">
        <a href="/about">
          <div className="self-stretch relative leading-[28px] flex items-center justify-center w-[81px] shrink-0">
            À propos
          </div>
        </a>
        <a href="/">
          <div className="self-stretch relative leading-[28px] flex items-center justify-center w-[81px] shrink-0">
            Carrières
          </div>
        </a>
        {(user===null||user.type==="user")&&(
        <a href="/">
          <div className="self-stretch relative leading-[28px] flex items-center justify-center w-[70px] shrink-0">
            Contact
          </div>
        </a>
        )}
        <a href="/">
          <div className="self-stretch relative leading-[28px] flex items-center justify-center w-[129px] shrink-0">
            Confidentialité
          </div>
        </a>
      </div>
    </div>
    </footer>
  );
};

export default footer;
